import { type } from "./type";

export const add = (Number=1)=>{
    console.log("in add")
    return {
        type : type.add,
        payLoad :Number
    }   
}

export const dec = (minu)=>{
    return {
        type : type.dec,
        payLoad : minus
    }   
}
